import React from 'react';
import './Home.css'; // Import your CSS file for styling
import profilePicture from '../image/IMG_6789.png'; // Import the image file

const Home = () => {
  return (
    <div className="home-container">
      <div className="hero">
        <div className="hero-content">
          <img src={profilePicture} alt="Pranav" className="profile-picture" />
          <div className="text-content">
            <h1>Welcome to My Portfolio</h1>
            <p>Hello! I'm Pranav, a Front End Developer. This is a showcase of my work and experience.</p>
            <div className="cta-buttons">
              <a href="/projects" className="btn">View Projects</a>
              <a href="/contact" className="btn">Contact Me</a>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
